module GHC.Show.Swiss where


-- | show_tuple function is in GHC.Show module but it does not export this function
showTuple :: [ShowS] -> ShowS 
showTuple ss = showChar '('
              . foldr1 (\s r -> s . showChar ',' . r) ss
              . showChar ')'

